  return (
    <>
      {data.map((curElem) => {
        return (
          <div className="Product">
            <img className="Product__image" src={props.image} alt="" />
            <p>
              <strong>{props.name}</strong>
            </p>
            <span>{props.description}</span>
            <p>
              {props.finalPrice}
              <span>{props.strickPrice}</span>
              <span>{props.discount}</span>
            </p>
          </div>
        );
      })}
    </>
  );
};

